import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";
import Banners from "./Banners/Banners";
import PopularProduct from "./PopularProduct/PopularProduct";





const Promotion = (props: any) => {


    return (
        <main>
            <Banners/>
            <PopularProduct/>


    <div className="wrapper" id='promotion'>
        <div className="promotion">
            <h2>Акции</h2>
            <div className="grid">
                <a href="#banner1" className='popup_link'><img alt="" data-src="img/баннеры/1.png"
                                                               className="lazy"/></a>
                <a href="#banner2" className='popup_link'><img alt="" data-src="img/баннеры/2.png"
                                                               className="lazy"/></a>
                <a href="#banner3" className='popup_link'><img alt="" data-src="img/баннеры/3.png"
                                                               className="lazy"/></a>
                <a href="#banner4" className='popup_link'><img alt="" data-src="img/баннеры/4.png"
                                                               className="lazy"/></a>
                <a href="#banner5" className='popup_link'><img alt="" data-src="img/баннеры/5.png"
                                                               className="lazy"/></a>
                <a href="#banner6" className='popup_link'><img alt="" data-src="img/баннеры/6.png"
                                                               className="lazy"/></a>
                <a href="#banner7" className='popup_link'><img alt="" data-src="img/баннеры/7.png"
                                                               className="lazy"/></a>
                <a href="#banner8" className='popup_link'><img alt="" data-src="img/баннеры/8.png"
                                                               className="lazy"/></a>
            </div>
        </div>
    </div>


        </main>
    );
}

export default Promotion;
